std::string ROT13(const std::string text)
{
	std::string encrypt = "";
	for (int i = 0; i < text.length(); i++)
	{
		if (isupper(text[i]))
		{
			encrypt += (text[i] - 'A' + 13) % 26 + 'A';
		}
		else if (islower(text[i]))
		{
			encrypt += (text[i] - 'a' + 13) % 26 + 'a';
		}
		else
		{
			encrypt += text[i];
		}
	}

	return encrypt;
}


